import axios from "axios";

const URL = "http://localhost:8000"
const END_POINT = {
    user: ''
}

export class UserService {
    getAll() {
        axios.get(`${URL}/${END_POINT.user}`);
    }
    create(user) {
        axios.post(
            `${URL}/${END_POINT.user}`, 
            user
        );
    }
}
